function Number(){
    let [counter, setCounter] = useState(0);
    return (
        <div className="Number">
            {counter}
        </div>
    )
}
function Buttons(){
    function plus() {
        return(
            {counter}+1)}
    return(
        <div className="Buttons">
            <button onClick={plus} className="btn btn-blue">Увеличить</button>
            <button className="btn btn-orange">Уменьшить</button>
            <button className="btn btn-grey">Сбросить</button>
        </div>
    )
}
export default Buttons;
